import React from 'react';
import './LoginComponent.css';
import ReactIcon from '../../assets/png/React.png';

function Login() {
    return(
        <div class="login-box">
            <div id="header-box">
                <img src={ReactIcon} id="react-logo" alt="Logo"></img><br />
                <b>Simple Login with React</b><br />
            </div>
            <div id="content-box">
                <div id="login">
                    <b>Login</b>
                </div>
                <div id="register">
                    <b>Register</b>
                </div>
            </div>
        </div>
    );
}

export default Login;
